import React from "react";
// import "./checkout.scss";

const CheckoutPage = () => {
  return (
    <div>
      <div>Product</div>
      <div>Description</div>
      <div>Quantity</div>
      <div>Price</div>
      <div>Remove</div>
    </div>
  );
};

export default CheckoutPage;
